import React, { useEffect, useState } from 'react';
import { getInvestmentData } from './googleSheetService';

function Dashboard() {
  const [data, setData] = useState(null);

  useEffect(() => {
    getInvestmentData().then(setData);
  }, []);

  if (!data) return <p>Loading data from Google Sheets...</p>;

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial' }}>
      <h2>ðŸ“Š Investment Dashboard</h2>
      <ul>
        <li><strong>Current Value:</strong> {data.currentValue}</li>
        <li><strong>Total Returns:</strong> {data.totalReturns}</li>
        <li><strong>Returns Percent:</strong> {data.returnsPercent}</li>
        <li><strong>Invested:</strong> {data.invested}</li>
        <li><strong>XIRR:</strong> {data.xirr}</li>
        <li><strong>1 Day Return:</strong> {data.dayReturn}</li>
        <li><strong>1 Day Return Percent:</strong> {data.dayReturnPercent}</li>
      </ul>
    </div>
  );
}

export default Dashboard;
